import Layout from '../components/Layout/Layout';
import Background from '../components/Background/Background';
import Middle from '../components/Middle/Middle';

function Homepage() {
	return (
		<Layout title="صفخه اصلی">
			<Background />
			<Middle />
		</Layout>
	);
}

export default Homepage;
